;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/gmm</span>","value":"#'gmm-iris/gmm"}
;; <=

;; **
;;; Now, we draw some samples and plot them.
;; **

;; @@
(defn draw-samples [n-samples thin]
  "simple helper to draw samples and thin them"
  (take-nth thin (take (* n-samples thin) 
                       (doquery :pgibbs gmm [X {:K 5}] :number-of-particles thin))))

;; draw samples; thin
(def samples (draw-samples 10 1000))

;; plot them, each; see how the samples evolve?
(map (fn [sample]
       (let [y-hat (:z (get-predicts sample))]
         (plot-pca X y-hat #(get colors %))))
     samples)

